How to encode/decode mongodb cursor?<p>I need to build a list of "pages" so part of this there will be a <a href="https://godoc.org/github.com/mongodb/mongo-go-driver/mongo#Cursor" rel="nofollow noreferrer">cursor</a>. The issue is that I can't find a way to encode(to string) and decode the cursor. Any idea? The <a href="https://godoc.org/github.com/mongodb/mongo-go-driver/mongo#Cursor" rel="nofollow noreferrer">Cursor</a> interface has no "encoding" method(there is ID, though undocumented) and there is no way to create a new cursor from a string(or int).</p>

<pre><code>type Cursor interface {

    // Get the ID of the cursor.
    ID() int64

    // Get the next result from the cursor.
    // Returns true if there were no errors and there is a next result.
    Next(context.Context) bool

    Decode(interface{}) error

    DecodeBytes() (bson.Reader, error)

    // Returns the error status of the cursor
    Err() error

    // Close the cursor.
    Close(context.Context) error
}
</code></pre>

<p><strong>Why do I need the cursor encoded?</strong> </p>

<p>To provide pagination to the end client through a html or JSON API.</p>

