<pre><code>it("Can create a subdocument", (done) =&gt; {
  const joe = new User({
    name: "joe",
  });

    joe.save()
        .then(() =&gt; User.findOne({ name: "joe"}))
        .then((user) =&gt; {
            assert(user.name === "joe")
            done();
        });
}
</code></pre>

