<pre><code>{
    "_id" : ObjectId("5b3ced158735f1196d73a743"),
    "cid" : 1,
    "foo" : [
        {
            "k" : "sport",
            "v" : "climbing"
        },
        {
            "k" : "sport",
            "v" : "soccer"
        },
        {
            "k" : "sport",
            "v" : "soccer"
        }
    ]
}
</code></pre>

<p>This Query just return the documents which contains a soccer field.</p>

<pre><code>db.coll.find({foo:{$elemMatch:{ v: "soccer"}} }, {"foo.$" : 1,cid:1})
</code></pre>

<p>returns:</p>

<pre><code>{ "_id" : ObjectId("5b3ced158735f1196d73a743"), "cid" : 1, "node" : [ { "k" : "sport", "v" : "climbing" } ] }
</code></pre>

<p>But I want to know, how many soccer-Elements are in each returned document. How can I count them? </p>

