Correct way to seed MongoDB with references via mongoose<p>I have three schemas, one which references two others:</p>

<p><strong>userSchema</strong></p>

<pre><code>{ name: String }
</code></pre>

<p><strong>postSchema</strong></p>

<pre><code>{ content: String }
</code></pre>

<p><strong>commentSchema</strong></p>

<pre><code>{ 
  content: String,
  user: { ObjectID, ref: 'User' },
  post: { ObjectID, ref: 'Post' }
}
</code></pre>

<p>How can I seed this database in a sane, scalable way? Even using bluebird promises it quickly becomes a nightmare to write.</p>

<p>My attempt so far involves multiple nested promises and is very hard to maintain:</p>

<pre><code>User
.create([{ name: 'alice' }])
.then(() =&gt; {
    return Post.create([{ content: 'foo' }])
})
.then(() =&gt; {
  User.find().then(users =&gt; {
    Post.find().then(posts =&gt; {
      // `users` isn't even *available* here!
      Comment.create({ content: 'bar', user: users[0], post: posts[0] })
    })
  })
})
</code></pre>

<p>This is clearly not the correct way of doing this. What am I missing?</p>

